@underdog.sd at @fallbrewingcompany Miramar! Heck yeah! This brewery heavy stretch of San Diego is overdue for a new leader in vegan food. So happy to see Underdog make their way up here with their top-tier vegan hot dogs, corn dogs, hush puppies, and burgers. 

Looking forward to more Fridays at Fall through September... then next first Friday  they will be at @firstfridaynightmarket ❤️😉

